import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
      
    //App
    appContainer:{
        width: 490,
    },
    
    //Header
    header:{
        alignItems:'center',
        backgroundColor:'#d96c06',
        flexDirection:'row',
        height:80, 
        padding:5,  
    },

    textheader:{
        fontSize:18,
        fontWeight:'bold',
        fontStyle:'italic',
        
    },

    textheader1:{
        justifyContent:"center",
        marginLeft:5,
     
     },

    imgheader:{
        height: 40,
        width:40,
        padding:25,
        marginLeft:5,
    },

    // Content



    //Footer
    footer:{
        alignItems:"center",
        backgroundColor:'#D96c06',
        flex:1,
        flexDirection:'row',
        justifyContent:'center',
        height:100,
        
    },

    textFooter:{
        padding:20,
    },
   

})
